$(function(){$(".navbar").hasClass("navbar-fallback")||$(window).scroll(function(){$(window).scrollTop()>70?$(".navbar, .nav-content").addClass("invert"):$(".navbar, .nav-content").removeClass("invert")}),$(document).ready(function(){$(".slick").slick({lazyLoad:"ondemand",infinite:!0,slidesToShow:4,autoplay:!0,autoplaySpeed:2e3,responsive:[{breakpoint:1100,settings:{slidesToShow:3}}]})})});